from app.mktcore.mdlimports import *

class MKT_FORECLOSED_PROPERTY(exmodel):
	ID 					= db.Column(db.String(14), primary_key=True)
	CollateralID 		= db.Column(db.String(14))
	CollateralDetailID	= db.Column(db.String(14))
	ForeclosedTransferID= db.Column(db.String(14))
	CollateralType 		= db.Column(db.String(2))
	Currency	 		= db.Column(db.String(3))
	PurchasePrice 		= db.Column(db.Numeric(25, 9))
	ValuationPrice 		= db.Column(db.Numeric(25, 9))
	Valuer 				= db.Column(db.String(50))
	Description 		= db.Column(db.Text)
	IssuedDate 			= db.Column(db.String(10))
	IssuedPlace 		= db.Column(db.String(50))	
	IssuedBy 			= db.Column(db.String(100))	
	CollateralNumber	= db.Column(db.String(25))	
	Province 			= db.Column(db.String(3))
	District 			= db.Column(db.String(5))
	Commune				= db.Column(db.String(7))
	Village 			= db.Column(db.String(9))
	ReceivedDate 		= db.Column(db.String(10))
	WithdrawalDate 		= db.Column(db.String(10))
	WithdrawalBy 		= db.Column(db.String(35))
	ReceivedBy 			= db.Column(db.String(35))
	OwnershipType   	= db.Column(db.String(1))
	OwnerName   		= db.Column(db.String(35))
	OwnerSpouseName 	= db.Column(db.String(35))
	RelationIndicator   = db.Column(db.String(3))
	FCOperation 		= db.Column(db.String(1))
	FCStatus 			= db.Column(db.String(1))
	FCDate	 			= db.Column(db.String(10))
	ForeclosedValue		= db.Column(db.Numeric(25, 9))
	SaleValue			= db.Column(db.Numeric(25, 9))
	CustomerID  		= db.Column(db.String(12))
	NewCollateralMainID = db.Column(db.String(14))
	NewValuationPrice 	= db.Column(db.Numeric(25, 9))
	NewValuer 			= db.Column(db.String(50))
	PaymentMethod 		= db.Column(db.String(8))
	SaleCategory 		= db.Column(db.String(15))
	SaleAcc 			= db.Column(db.String(20))
	Remark				= db.Column(db.String(50))
	GainLoss 			= db.Column(db.Numeric(25, 9))

